import React, { Component } from "react";

class LoginDisplay extends Component {
      render() {
            return (
                  <>
                        <div className="loginDisplay"> 
                              <div className = "loginBox"> 
                              
                                    <div class="input-group flex-nowrap">
                                          <span class="input-group-text counterFormInputBoxes" id="addon-wrapping">@</span>
                                          <input type="text" class="form-control counterFormInputBoxes" placeholder="Username" aria-label="Username" aria-describedby="addon-wrapping" />
                                          
                                          <span class="input-group-text counterFormInputBoxes" id="inputGroup-sizing-default">Default</span>
                                          <input type="text" class="form-control counterFormInputBoxes" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" />

                                    </div>
                              
                              </div>
                        </div>

                  </>
            );
      }
}

export default LoginDisplay;
